import React from "react"

export default class MyList extends React.Component {
    constructor(props) {
        super(props)
        this.state = {opened: false}
        this.checker = this.checker.bind(this)
        this.opener = this.opener.bind(this)
    }
    checker(state) {
        let classname = state ? 'open' : 'closed'
        return classname
    }
    opener() {
        this.setState(!this.state.opened)
    }
    render() {
        return(
            <ul onClick={this.opener} classname={this.checker(this.state.opened)}>
                {this.props.items.map(item=> 
                    <li key={new Date}>{item.text}</li>)
                    }
            </ul>
        )
    }
}
